import './App.css';
import Addvolunteer from './components/addvolunteer';

function App() {
  return (
    <BrowseRouter>
    <Routes>
    <Route path='/' element={<Addvolunteer />} />
      </Routes>
      </BrowseRouter>
  );
}

export default App;
